import React from "react";
import { useEffect, useState } from "react";
//Redux
import { useSelector, useDispatch } from "react-redux";
import { useRouteMatch } from "react-router-dom";
//Material UI
import Typography from "@material-ui/core/Typography";
import Button from "@material-ui/core/Button";
import Grid from "@material-ui/core/Grid";
import ShareIcon from "@material-ui/icons/Share";
import EditIcon from "@material-ui/icons/Edit";

import DeleteForeverIcon from "@material-ui/icons/DeleteForever";
//Components
import makeStyles from "./Lists_styles";
import Regular_List from "./Regular_List/Regular_List";
import Edit_List from "./Edit_List/Edit_List";
//Actions
import { fecth_list_items } from "../../actions/actions";
import { fetch_store_items } from "../../actions/actions";

const Lists = () => {
	const { url } = useRouteMatch();
	const styles = makeStyles();
	const items = useSelector((state) => state.lists); //get items
	const list_Name = useSelector((state) => state.homePage.name); //gets name of the list
	const user = useSelector((state) => state.login.profileObj); //gets user information from reducer
	const [isEditable, set_isEditable] = useState(false);

	console.log(url);
	//Dispatch an action to the reducers

	//console.log(`List from Lists Component: \n ${JSON.stringify(list_Name)}`);
	//console.log("Selector: " + JSON.stringify(selector));
	//console.log(`Items from Lists Component: \n ${JSON.stringify(items)}`);

	//======================================================================

	return (
		<>
			{false ? (
				<Regular_List items={items} />
			) : url === "/User/Lists/listName/edit" ? (
				<Edit_List items={items} set_isEditable={set_isEditable} />
			) : null}
		</>
	);
};

export default Lists;
